/* ============================================
   BITS OF GOOD - PROFILE CARD
   Component-Based Architecture
   ============================================
   
   Mental Model (for systems/OOP thinkers):
   - cardData     = struct / object instance
   - Components   = functions that return formatted output (like toString())
   - Card()       = main assembly function (like a compositor)
   - render()     = write to output (like display/serial write)
   
   ============================================ */

// ============================================
// DATA LAYER - Edit your info here
// ============================================

const cardData = {
    // REQUIRED: Your name
    name: "Sasha Vasu",
    
    // REQUIRED: Your major(s)
    major: "Computer Science / Electrical Engineering",
    
    // REQUIRED: Your year
    year: "Junior",
    
    // REQUIRED: Something you're passionate about related to social good
    // Tip: Be specific and personal, not generic
    passion: "Would love to build something for Bits of Good! So far, I have loved teaching and passing on my tech knowledge to others, and Bits of Good seems like the perfect opportunity to continue helping those around me. Meet my dog below, Zoia!",
    
    
    // OPTIONAL: Profile image
    // Option A: File path (e.g., "assets/profile.jpg")
    // Option B: Base64 data URI (e.g., "data:image/jpeg;base64,/9j/4AAQ...")
    // Option C: null (shows initials instead)
    image: "data:image/jpeg;base64,",
    
    // Used if image is null - first letters shown in circle
    initials: "SV"
};


// ============================================
// COMPONENT FUNCTIONS
// Each takes data, returns HTML string
// ============================================

/**
 * ProfileImage Component
 * Renders either an image or initials placeholder
 * @param {Object} data - cardData object
 * @returns {string} HTML string
 */
function ProfileImage(data) {
    const imageContent = data.image 
        ? `<img 
               class="card__image" 
               src="${data.image}" 
               alt="Profile photo of ${data.name}"
           >`
        : `<div class="card__image-placeholder">${data.initials}</div>`;
    
    return `
        <div class="card__image-wrapper">
            ${imageContent}
        </div>
    `;
}

/**
 * InfoSection Component
 * Renders name, major, and year
 * @param {Object} data - cardData object
 * @returns {string} HTML string
 */
function InfoSection(data) {
    return `
        <h1 class="card__name">${data.name}</h1>
        <p class="card__details">${data.major} <br> ${data.year}</p>
        <div class="card__divider"></div>
    `;
}

/**
 * PassionSection Component
 * Renders the social good passion statement
 * @param {Object} data - cardData object
 * @returns {string} HTML string
 */
function PassionSection(data) {
    return `
        <p class="card__passion">${data.passion}</p>
    `;
}

/**
 * LocationSection Component
 * Renders location if provided, empty string if not
 * @param {Object} data - cardData object
 * @returns {string} HTML string
 */
function LocationSection(data) {
    if (!data.location) return '';
    
    return `
        <p class="card__location"> ${data.location}</p>
    `;
}


// ============================================
// ASSEMBLY FUNCTION
// Composes components into final card
// ============================================

/**
 * Card Component (Main Assembly)
 * Combines all sub-components
 * @param {Object} data - cardData object
 * @returns {string} Complete HTML string
 */
function Card(data) {
    return `
        ${ProfileImage(data)}
        <div class="card__content">
            ${InfoSection(data)}
            ${PassionSection(data)}
            ${LocationSection(data)}
        </div>
    `;
}


// ============================================
// RENDER - Write to DOM
// ============================================

/**
 * Renders the card to the target element
 * Like writing to a display buffer
 */
function render() {
    const target = document.getElementById('app');
    if (target) {
        target.innerHTML = Card(cardData);
    }
}

// Execute on DOM ready
document.addEventListener('DOMContentLoaded', render);
